import React, { useState, useEffect } from "react";
import { MDBBtn, MDBContainer, MDBCol, MDBRow } from "mdb-react-ui-kit";
import Transaction from "../components/Transaction";
import axiosInstance from "../axiosApi";
import { useParams } from "react-router-dom";

function Transactions() {
  const [transactionsData, setTransactionsData] = useState([
    {
      id: 1,
      title: "Keychron K2 Keyboard",
      added: "28.12.2021",
      exportAddress: "Keychron",
      exportStreet: "9 Yin Chon Street",
      exportCity: "Mongkok",
      exportCountry: "Hong Kong",
      importAddress: "Max Mustermann",
      importStreet: "Musterstr. 23",
      importCity: "37073 Göttingen",
      importCountry: "Deutschland",
      stakeholderCount: 2,
    },
    {
      id: 2,
      title: "Monitore LG 35WN73A",
      added: "13.11.2021",
      exportAddress: "LG Electronics",
      exportStreet: "128, Yeoui-daero",
      exportCity: "Seoul",
      exportCountry: "South Korea",
      importAddress: "Max Mustermann",
      importStreet: "Musterstr. 23",
      importCity: "37073 Göttingen",
      importCountry: "Deutschland",
      stakeholderCount: 3,
    },
  ]);

  useEffect(() => {
    axiosInstance.get('transactions/').then((res) => {
      console.log(res.data);
      setTransactionsData(res.data);
    });
  }, []);



  console.log(transactionsData);
  return (
    <div>
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <h3>Aufträge</h3>
          </MDBCol>
          <MDBCol>
            <MDBBtn className="float-end" color="success">
              Auftrag hinzufügen
            </MDBBtn>
          </MDBCol>
        </MDBRow>
        <br />
        {transactionsData.map((transactionData) => (
          <React.Fragment>
            <Transaction
              key={transactionData.id}
              id={transactionData.id}
              title={transactionData.title}
              added={transactionData.date_added}
              exportAddress={transactionData.exportAddress}
              exportStreet={transactionData.exportStreet}
              exportCity={transactionData.exportCity}
              exportCountry={transactionData.exportCountry}
              importAddress={transactionData.importAddress}
              importStreet={transactionData.importStreet}
              importCity={transactionData.importCity}
              importCountry={transactionData.importCountry}
              stakeholderCount={transactionData.stakeholderCount}
            />
            <br />
          </React.Fragment>
        ))}
      </MDBContainer>
    </div>
  );
}

export default Transactions;
